import {useState} from 'react'

const Header =(props)=>{

    const [counter, setCounter] = useState(0)
    var x =0

    const onButtonClicked =()=>{
        setCounter(counter+1)
        x=5
    }

    return(
        <div>
            <p>
                {props.toUpper(props.name)}
            </p>

            <p>
                {x}
            </p>

            <button style={{background:'red'}} onClick={()=>{onButtonClicked()}}/>

        </div>
    )
}

export default Header
